        backgroundColor: "lightblue",
      }}
    >
      {grid.map((row, i) =>
        row.map((col, j) => (
          <div
            className="spot"
            key={`${i}-${j}`}
            onDragOver={(e) => {
              e.preventDefault();
              console.log("over in grid");
            }}
            onDrop={(e) => {
              e.preventDefault();
              console.log(i, j);
            }}
            //onClick={() => gridOnClickHandler(i, j)}
            style={{
              backgroundColor: "white", //handleColor(grid[i][j])
              height: "18px",
              width: "18px",
              border: "solid 1px black",
            }}
          />
        ))
      )}
    </div>
  );
}

export default Grid;
